import React, { Component } from 'react'
import { Header, Container, Footer} from '../index';

class Browse extends Component {
    render() {
        return (
            <>
                <Header/>
                <Container>
                    <div></div>
                </Container>
                <Footer/>
            </>
        )
    }
}

export default Browse;
